import React, { useState } from "react";

function App() {
  const [todos, setTodos] = useState([
    { text: "Learn React", isCompleted: false },
    { text: "Meet friend for lunch", isCompleted: false },
    { text: "Build very cool todo app", isCompleted: false },
  ]);
}

export default App;
